import styled from 'styled-components';
import tw from 'twin.macro';
import { Logo } from '../logo';


const NavbarContainer = styled.div`
    min-height: 68px;
    ${tw`
        w-full
        max-w-2xl
        flex
        flex-row
        items-center
        lg:pl-12
        lg:pr-12
        justify-between
    `}
`;

const LogoContainer = styled.div`

`;

export function Navbar() {
    return <NavbarContainer>
        <LogoContainer>
            <Logo />
        </LogoContainer>
    </NavbarContainer>
}
